import java.io.*;
import java.util.*;

public class Main {
    static final int N = 105;
    static final int M = 1005;
    static int n, m, s, t;
    static long[][] c = new long[N][N];
    static long[][] f = new long[N][N];
    static long[][] g = new long[N][N];
    static long[] d = new long[N];
    static long[] h = new long[N];
    static long[] q = new long[N];
    static long[] in = new long[N];
    static long[] out = new long[N];
    static long[] val = new long[N];
    static long[] pre = new long[N];
    static long[] nxt = new long[N];
    static long[] to = new long[N];
    static long[] cap = new long[N];
    static long[] cost = new long[N];
    static long[] head = new long[N];
    static long cnt;

    static void add(int u, int v, long w, long c) {
        to[++cnt] = v;
        cap[cnt] = w;
        cost[cnt] = c;
        nxt[cnt] = head[u];
        head[u] = cnt;
        to[++cnt] = u;
        cap[cnt] = 0;
        cost[cnt] = -c;
        nxt[cnt] = head[v];
        head[v] = cnt;
    }

    static boolean spfa() {
        Arrays.fill(d, Long.MAX_VALUE);
        Arrays.fill(h, 0);
        Arrays.fill(in, 0);
        Arrays.fill(out, 0);
        Arrays.fill(val, 0);
        Arrays.fill(pre, 0);
        Arrays.fill(nxt, 0);
        Arrays.fill(q, 0);
        d[s] = 0;
        q[0] = s;
        in[s] = 1;
        int front = 0, rear = 0;
        while (front <= rear) {
            int u = (int) q[front++];
            in[u] = 0;
            for (int i = (int) head[u]; i != 0; i = (int) nxt[i]) {
                int v = (int) to[i];
                if (cap[i] > 0 && d[v] > d[u] + cost[i]) {
                    d[v] = d[u] + cost[i];
                    pre[v] = i;
                    h[v] = i ^ 1;
                    val[v] = Math.min(cap[i], out[u] - in[u]);
                    if (in[v] == 0) {
                        q[++rear] = v;
                        in[v] = 1;
                    }
                }
            }
        }
        return d[t] != Long.MAX_VALUE;
    }

    static long dfs(int u, long flow) {
        if (u == t)
            return flow;
        long res = 0;
        for (int i = (int) pre[u]; i != 0; i = (int) pre[u]) {
            int v = (int) to[i ^ 1];
            if (d[v] == d[u] + cost[i] && val[v] > 0) {
                long t = dfs(v, Math.min(val[v], flow));
                if (t == 0)
                    pre[v] = 0;
                flow -= t;
                res += t;
                val[u] -= t;
                val[v] += t;
                if (flow == 0)
                    break;
            }
        }
        return res;
    }

    static long dinic() {
        long res = 0;
        while (spfa()) {
            for (int i = 1; i <= n; i++)
                out[i] = in[i] = 0;
            while (true) {
                long t = dfs(s, Long.MAX_VALUE);
                if (t == 0)
                    break;
                res += t;
            }
        }
        return res;
    }

    static long calc() {
        long res = 0;
        for (int i = 1; i <= cnt; i++)
            res += cap[i] * cost[i];
        return res;
    }

    public static void main(String[] args) throws IOException {
        Scanner sc = new Scanner(System.in);
        n = sc.nextInt();
        m = sc.nextInt();
        s = sc.nextInt();
        t = sc.nextInt();
        for (int i = 1; i <= m; i++) {
            int u = sc.nextInt();
            int v = sc.nextInt();
            int w = sc.nextInt();
            int c = sc.nextInt();
            add(u, v, w, c);
        }
        long res = 0;
        for (int i = 1; i <= n; i++)
            for (int j = 1; j <= n; j++)
                f[i][j] = g[i][j] = 0;
        for (int i = 1; i <= n; i++)
            f[i][i] = 1;
        for (int k = 1; k <= n; k++)
            for (int i = 1; i <= n; i++)
                for (int j = 1; j <= n; j++)
                    f[i][j] = Math.max(f[i][j], Math.min(f[i][k], f[k][j]));
        for (int i = 1; i <= n; i++)
            for (int j = 1; j <= n; j++)
                g[i][j] = f[i][j] * dinic();
        long max = 0;
        for (int i = 1; i <= n; i++)
            max = Math.max(max, g[s][i]);
        long ans = 0;
        for (int i = 1; i <= n; i++)
            for (int j = 1; j <= n; j++)
                ans += g[i][j] * g[i][j] * calc();
        ans = (ans - max * max * calc()) / 2;
        System.out.println(ans + "/" + max);
    }
}

